- input: "TEXT\x1CC00305797\x1C.TEXT\x1C\x1CF3XA\x1CAmerica's Foundation received
    payments for list rental services, and these payments did not exceed the usual
    and normal charge for these services.  We assessed the usual and normal charge
    for these services by comparing the amounts received to previous amounts America's
    Foundation has either researched, or been charged to purchase or rent lists from
    list brokerage firms the PAC has used.                                                                                                                                                                       We
    are filing this amended report in response to the Request For Additional Information
    (RFAI) dated August 26, 2010.  (1) Please note that this amended report inculdes
    the office sought, state, and congressional district (if applicable) for each
    contribution listed on Line 23.  (2) Please note that all expenditures described
    as 'Compensation for Fundraising Svcs' and listed on Schedule B, Line 21(b) were
    America's Foundation PAC expenses, and none of these expenditures were made on
    behalf of a specifically identified federal candidate.   (3) All of the expenditures
    listed on Schedule B, Line 21(b) were PAC expenses and none of these expenditures
    were for public communications or voter drive activity that contained express
    advocacy of a clearly identified federal candidate.\n"
